В Solidity есть глобальная переменная tx.origin, которая проходит через весь стек вызовов и содержит адрес учетной записи, которая первоначально отправила вызов (или транзакцию). Использование этой переменной для аутентификации в смарт-контракте делает контракт уязвимым для фишинговой атаки. Примечание: Для дальнейшего чтения см. вопросы dbryson на Ethereum Stack Exchange, "Tx.Origin и Ethereum Oh My!" Питера Вессенеса и "Solidity: Атаки на Tx Origin" Криса Ковердейла. Уязвимость Контракты, авторизующие пользователей с помощью переменной tx.origin, обычно уязвимы к фишинговым атакам, которые могут обманом заставить пользователей выполнить аутентифицированные действия в уязвимом контракте. Рассмотрим простой контракт в Phishable.sol. Пример 13. Phishable.sol contract Phishable { address public owner; constructor (address _owner) { owner = _owner; } function () external payable {} // collect ether function withdrawAll(address _recipient) public { require(tx.origin == owner); _recipient.transfer(this.balance); }
} Обратите внимание, что в строке 11 контракт разрешает функцию withdrawAll с использованием tx.origin. Этот контракт позволяет злоумышленнику создать атакующий контракт вида: import "Phishable.sol"; contract AttackContract { Phishable phishableContract; address attacker; // The attacker's address to receive funds constructor (Phishable _phishableContract, address _attackerAddress) { phishableContract = _phishableContract; attacker = _attackerAddress; } function () payable { phishableContract.withdrawAll(attacker); }
} Злоумышленник может замаскировать этот контракт под свой собственный частный адрес и с помощью социальной инженерии заставить жертву (владельца фишингуемого контракта) отправить на этот адрес какую-либо транзакцию - возможно, переслать этому контракту некоторое количество эфира. Жертва, если не будет осторожна, может не заметить, что на адресе злоумышленника находится код, или злоумышленник может выдать его за кошелек с мультиподписью или какой-нибудь продвинутый кошелек для хранения данных (помните, что исходный код публичных контрактов по умолчанию недоступен). В любом случае, если жертва отправит транзакцию с достаточным количеством газа на адрес AttackContract, она вызовет функцию fallback, которая, в свою очередь, вызовет функцию withdrawAll контракта Phishable с параметром attacker. Это приведет к выводу всех средств из контракта Phishable на адрес атакующего. Это происходит потому, что адрес, который первым инициализировал вызов, был жертвой (т.е. владельцем контракта Phishable). Поэтому tx.origin будет равен owner и требование в строке 11 контракта Phishable пройдет. Профилактические методы tx.origin не следует использовать для авторизации в смарт-контрактах. Это не означает, что переменная tx.origin никогда не должна использоваться. У нее есть несколько законных случаев использования в смарт-контрактах. Например, если нужно запретить внешним контрактам вызывать текущий контракт, можно реализовать требование вида require(tx.origin == msg.sender). Это предотвращает использование промежуточных контрактов для вызова текущего контракта, ограничивая контракт обычными адресами без кода.

334.body:
Использование Oraclize для обновления курса ETH/USD из внешнего источника - это пример Solidity, демонстрирующий, как Oraclize можно использовать для постоянного опроса цены ETH/USD из API и хранения результата в удобном для использования виде. Пример 1. Использование Oraclize для обновления курса ETH/USD из внешнего источника /* Тикер цен ETH/USD, использующий API CryptoCompare Этот контракт хранит в памяти обновленную цену ETH/USD, который обновляется каждые 10 минут. */ pragma solidity ^0.4.1;
import "github.com/oraclize/ethereum-api/oraclizeAPI.sol"; /* Методы с префиксом "oraclize_" указывают на наследование от "usingOraclize" */
контракт EthUsdPriceTicker используетсяOraclize { uint public ethUsd; событие newOraclizeQuery(string description); событие newCallbackResult(string result); function EthUsdPriceTicker() payable { // сигнализирует о генерации доказательств TLSN и их хранении на IPFS oraclize_setProof(proofType_TLSNotary | proofStorage_IPFS); // запрос запроса queryTicker(); } function __callback(bytes32 _queryId, string _result, bytes _proof) public { if (msg.sender != oraclize_cbAddress()) throw; newCallbackResult(_result); /* * Разберите строку результата в целое число без знака для использования в цепи. * Использует унаследованный помощник "parseInt" из "usingOraclize", позволяя * строковый результат, такой как "123.45", должен быть преобразован в uint 12345. */ ethUsd = parseInt(_result, 2); // вызывается из обратного вызова, поскольку мы опрашиваем цену queryTicker(); } function queryTicker() external payable { if (oraclize_getPrice("URL") > this.balance) { newOraclizeQuery("Запрос Oraclize НЕ был отправлен, пожалуйста, добавьте немного ETH чтобы покрыть плату за запрос"); } else { newOraclizeQuery("Запрос Oraclize был отправлен, ожидаем ответа для ответ..."); // параметрами запроса являются (задержка в секундах, тип источника данных, // аргумент источника данных) // указывает JSONPath, чтобы получить определенную часть результата JSON API oraclize_query(60 * 10, "URL", "json(https://min-api.cryptocompare.com/data/price?\ fsym=ETH&tsyms=USD,EUR,GBP).USD"); } }
} Для интеграции с Oraclize контракт EthUsdPriceTicker должен быть дочерним для usingOraclize; контракт usingOraclize определен в файле oraclizeAPI. Запрос данных выполняется с помощью функции oraclize_query, которая наследуется от контракта usingOraclize. Это перегруженная функция, которая ожидает как минимум два аргумента: Поддерживаемый источник данных для использования, например URL, WolframAlpha, IPFS или вычисление Аргумент для данного источника данных, который может включать использование вспомогательных средств разбора JSON или XML Запрос цены выполняется в функции queryTicker. Для выполнения запроса Oraclize требует уплаты небольшой платы в эфире, покрывающей стоимость газа для обработки результата и передачи его в функцию __callback, а также сопутствующую наценку за услугу. Эта сумма зависит от источника данных и, если указано, от типа требуемого доказательства подлинности. После получения данных функция __callback вызывается учетной записью, контролируемой Oraclize, которой разрешено выполнять обратный вызов; она передает значение ответа и уникальный аргумент queryId, который, например, может использоваться для обработки и отслеживания нескольких ожидающих обратных вызовов от Oraclize. Поставщик финансовых данных Thomson Reuters также предоставляет сервис оракула для Ethereum под названием BlockOne IQ, позволяющий запрашивать рыночные и справочные данные смарт-контрактами, работающими в частных или разрешенных сетях. Контракт вызова службы BlockOne IQ для получения рыночных данных показывает интерфейс для оракула и клиентский контракт, который будет выполнять запрос. Пример 2. Контракт, вызывающий службу BlockOne IQ для получения рыночных данных pragma solidity ^0.4.11; contract Oracle { uint256 public divisor; function initRequest( uint256 queryType, function(uint256) external onSuccess, function(uint256 ) external onFailure) public returns (uint256 id); function addArgumentToRequestUint(uint256 id, bytes32 name, uint256 arg) public; function addArgumentToRequestString(uint256 id, bytes32 name, bytes32 arg) public; function executeRequest(uint256 id) public; function getResponseUint(uint256 id, bytes32 name) public constant returns(uint256); function getResponseString(uint256 id, bytes32 name) public constant returns(bytes32); function getResponseError(uint256 id) public constant returns(bytes32); function deleteResponse(uint256 id) public constant;
} contract OracleB1IQClient { Oracle private oracle; event LogError(bytes32 description); function OracleB1IQClient(address addr) external payable { oracle = Oracle(addr); getIntraday("IBM", now); } function getIntraday(bytes32 ric, uint256 timestamp) public { uint256 id = oracle.initRequest(0, this.handleSuccess, this.handleFailure); oracle.addArgumentToRequestString(id, "symbol", ric); oracle.addArgumentToRequestUint(id, "timestamp", timestamp); oracle.executeRequest(id); } function handleSuccess(uint256 id) public { assert(msg.sender == address(oracle)); bytes32 ric = oracle.getResponseString(id, "symbol"); uint256 open = oracle.getResponseUint(id, "open"); uint256 high = oracle.getResponseUint(id, "high"); uint256 low = oracle.getResponseUint(id, "low"); uint256 close = oracle.getResponseUint(id, "close"); uint256 bid = oracle.getResponseUint(id, "bid"); uint256 ask = oracle.getResponseUint(id, "ask"); uint256 timestamp = oracle.getResponseUint(id, "timestamp"); oracle.deleteResponse(id); // Do something with the price data } function handleFailure(uint256 id) public { assert(msg.sender == address(oracle)); bytes32 error = oracle.getResponseError(id); oracle.deleteResponse(id); emit LogError(error); } } Запрос данных инициируется с помощью функции initRequest, которая позволяет указать тип запроса (в данном примере запрос внутридневной цены), а также две функции обратного вызова. Функция возвращает идентификатор uint256, который затем может быть использован для ввода дополнительных аргументов. Функция addArgumentToRequestString используется для указания кода инструмента Reuters (RIC), здесь для акций IBM, а addArgumentToRequestUint позволяет указать временную метку. Теперь, передав псевдоним block.timestamp, вы получите текущую цену для IBM. Затем запрос выполняется функцией executeRequest. После обработки запроса контракт oracle вызывает функцию обратного вызова onSuccess с идентификатором запроса, позволяя получить результирующие данные; в случае неудачи обратный вызов onFailure возвращает код ошибки. Доступные поля, которые могут быть получены в случае успеха, включают цены открытия, максимума, минимума, закрытия (OHLC), а также цены покупки/продажи.

